    //Setting\\
    ElinaBotMd.decodeJid = (jid) => {
        if (!jid) return jid
        if (/:\d+@/gi.test(jid)) {
            let decode = jidDecode(jid) || {}
            return decode.user && decode.server && decode.user + '@' + decode.server || jid
        } else return jid
    }
    
    ElinaBotMd.ev.on('contacts.update', update => {
        for (let contact of update) {
            let id = ElinaBotMd.decodeJid(contact.id)
            if (store && store.contacts) store.contacts[id] = { id, name: contact.notify }
        }
    })

    ElinaBotMd.getName = (jid, withoutContact  = false) => {
        id = ElinaBotMd.decodeJid(jid)
        withoutContact = ElinaBotMd.withoutContact || withoutContact 
        let v
        if (id.endsWith("@g.us")) return new Promise(async (resolve) => {
            v = store.contacts[id] || {}
            if (!(v.name || v.subject)) v = ElinaBotMd.groupMetadata(id) || {}
            resolve(v.name || v.subject || PhoneNumber('+' + id.replace('@s.whatsapp.net', '')).getNumber('international'))
        })
        else v = id === '0@s.whatsapp.net' ? {
            id,
            name: 'WhatsApp'
        } : id === ElinaBotMd.decodeJid(ElinaBotMd.user.id) ?
            ElinaBotMd.user :
            (store.contacts[id] || {})
            return (withoutContact ? '' : v.name) || v.subject || v.verifiedName || PhoneNumber('+' + jid.replace('@s.whatsapp.net', '')).getNumber('international')
    }
    
ElinaBotMd.sendContact = async (jid, kon, quoted = '', opts = {}) => {
        let list = []
        for (let i of kon) {
            list.push({
                displayName: await ElinaBotMd.getName(i + '@s.whatsapp.net'),
                vcard: `BEGIN:VCARD\nVERSION:3.0\nN:${await ElinaBotMd.getName(i + '@s.whatsapp.net')}\nFN:${await ElinaBotMd.getName(i + '@s.whatsapp.net')}\nitem1.TEL;waid=${i}:${i}\nitem1.X-ABLabel:ELISA BOT MD 2022\nitem2.EMAIL;type=INTERNET:GitHub: ELISA-BOT\nEND:VCARD`
            })
        }
        ElinaBotMd.sendMessage(jid, { contacts: { displayName: `${list.length} Contact`, contacts: list }, ...opts }, { quoted })
        }
    
    ElinaBotMd.setStatus = (status) => {
        ElinaBotMd.query({
            tag: 'iq',
            attrs: {
                to: '@s.whatsapp.net',
                type: 'set',
                xmlns: 'status',
            },
            content: [{
                tag: 'status',
                attrs: {},
                content: Buffer.from(status, 'utf-8')
            }]
        })
        return status
    }
	
    ElinaBotMd.public = true

    ElinaBotMd.serializeM = (m) => smsg(ElinaBotMd, m, store)

    ElinaBotMd.ev.on('connection.update', async (update) => {
        const { connection, lastDisconnect } = update	    
        if (connection === 'close') {
        let reason = new Boom(lastDisconnect?.error)?.output.statusCode
            if (reason === DisconnectReason.badSession) { console.log(`Bad Session File, Please Delete Session and Scan Again`); ElinaBotMd.logout(); }
            else if (reason === DisconnectReason.connectionClosed) { console.log("ðŸ’ƒ Connection closed, reconnecting...."); startElinaBotMd(); }
            else if (reason === DisconnectReason.connectionLost) { console.log("ðŸ’ƒ Connection Lost from Server, reconnecting..."); startElinaBotMd(); }
            else if (reason === DisconnectReason.connectionReplaced) { console.log("ðŸ’ƒ Connection Replaced, Another New Session Opened, Please Close Current Session First"); ElinaBotMd.logout(); }
            else if (reason === DisconnectReason.loggedOut) { console.log(`ðŸ’ƒ Device Logged Out, Please Scan Again And Run.`); ElinaBotMd.logout(); }
            else if (reason === DisconnectReason.restartRequired) { console.log("ðŸ’ƒ Restart Required, Restarting..."); startElinaBotMd(); }
            else if (reason === DisconnectReason.timedOut) { console.log("ðŸ’ƒ Connection TimedOut, Reconnecting..."); startElinaBotMd(); }
            else ElinaBotMd.end(`ðŸ’ƒ Unknown DisconnectReason: ${reason}|${connection}`)
        }
        console.log('Connected...', update)
    })

